import "./App.css";
import React, { Component } from "react";
import name from "./name.png";

export default class App extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        <a
          href="/"
          aria-current="page"
          class="logo-link w-nav-brand w--current"
          aria-label="home"
        >
          <img src={name} width="149" alt="" class="logo-image" />
        </a>
        <div class="navigation-wrap">
          <nav role="navigation" class="navigation-items w-nav-menu">
            <a href="/" aria-current="page" class="navigation-item w-nav-link w--current">WORK</a>
            <a href="/about" class="navigation-item w-nav-link">About</a>
          </nav>
          <div class="menu-button w-nav-button" style="-webkit-user-select: text;" aria-label="menu" role="button" tabindex="0" aria-controls="w-nav-overlay-0" aria-haspopup="menu" aria-expanded="false">
              <img src="https://uploads-ssl.webflow.com/61720fa5f2e75f41ddacc9a4/61720fa5f2e75f48feacc9dd_menu-icon.png" width="22" alt="" class="menu-icon"/>
          </div></div>
        <div>Navigation</div>
        <div>
          <div></div>
          <div></div>
          <div></div>
          <div></div>
        </div>
      </div>
    );
  }
}
